import "./App.css";
import ExpenseItem from "./comonents/ExpenseItems";
import Card from "./comonents/Card";
import React from "react";
function App() {
  const expenses = [
    { title: "Car", amount: 214234, date: new Date(2003, 7, 1) },
    { title: "asdf", amount: 334, date: new Date(2003, 6, 30) },
    { title: "333", amount: 11, date: new Date(2003, 11, 15) },
    { title: "Ca111r", amount: 2411, date: new Date(2003, 8, 4) },
  ];

  const expenseItems = expenses.map((expense, index) => (
    <ExpenseItem
      className="expense"
      title={expense.title}
      amount={expense.amount}
      date={expense.date}
    />
  ));
  // altentave way ExpenseItem(props)
  // <ExpenseItem>expense= {expenses[index]} </ExpenseItem>
  //and change in the component file {props.title}

  //and can use another way that is by destractring props object  as >>   ExpenseItem({tiltle, amount,  })
  return (
    <div>
      <h2 className="App-header">Le't get started</h2>
      <Card>
        <div className="expense">{expenseItems}</div>
      </Card>
    </div>
  );
}
export default App;

